<span class="line"><span style="color:#9ECBFF;">&#39;&#39;&#39;我们通过添加所有节点来创建模型，然后通过在节点之间添加边来描述哪个节点是另一个节点的父节点（回想一下，贝叶斯网络是一个有向图，节点之间由箭头组成）。&#39;&#39;&#39;</span></span>
